|Game Description|
+----------------+

Join sage Arcanius and his apprentice Lidia in ancient Greece where you'll help decode a secret message from high priests. Match gems to obtain letters of the message and avert a war between the gods!

+----------------------------------+
|Instructions / System Requirements|
+----------------------------------+

No install or crack is required for this portable version. Extract the ZIP file and create a shortcut to the executable (EXE) to play.

- Windows 2000/XP/Vista

- 500MHz processor or better

- 256 MB RAM

- 16-bit Graphics and Sound Card

- DirectX 7.0 or later

